import React, { useState, useEffect } from 'react';
import '../../src/App.css';
import { BrowserRouter as Router, Route, Routes, Link, useLocation } from 'react-router-dom';
import axios from 'axios';
import Map from 'react-map-gl';

const Explore = () => {
  const [events, setEvents] = useState([]);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const response = await fetch('http://localhost:8000/api/getEvents');
        const data = await response.json();
        setEvents(data.data);
      } catch (error) {
        console.error('Error fetching data:', error);
      }
    };

    fetchData();
  }, []);

  return (
    <div>
      <h1 className='event-list-heading'>Event List</h1>

      <div className="events-top-comp">
        <div className='left-panel'>
          <div>
            <p>Left Panel</p>
          </div>
        </div>
        <div className='right-panel'>
          <Map
            mapboxAccessToken="pk.eyJ1IjoiZGVpb25zdGZsZXVyIiwiYSI6ImNscTFoZ21uejA4bmgyam1xc2Y5MmFwc2MifQ.1jezNRykcGiitrVZfkdrDQ"
            initialViewState={{
              longitude: -122.4,
              latitude: 37.8,
              zoom: 14
            }}
            style={{ width: '100%', height: '100%' }}
            mapStyle="mapbox://styles/mapbox/streets-v9"
          />
        </div>
      </div>
    </div>
  );
};

export default Explore;
